css:
.text-info code {
  color: #6494ed;
  background: rgba(0, 136, 255, 0.2);
}
.text-info a,
.text-info a code {
  text-decoration: underline;
  color: #3674e7;
}
.text-info a:hover,
.text-info a code:hover {
  color: #1f64e5;
}
.text-success code {
  color: #73c990;
  background: rgba(32, 182, 132, 0.2);
}
.text-success a,
.text-success a code {
  text-decoration: underline;
  color: #4fba73;
}
.text-success a:hover,
.text-success a code:hover {
  color: #43ad66;
}
.text-warning code {
  color: #e2c08d;
  background: rgba(204, 133, 51, 0.2);
}
.text-warning a,
.text-warning a code {
  text-decoration: underline;
  color: #d8aa64;
}
.text-warning a:hover,
.text-warning a code:hover {
  color: #d39f50;
}
.text-error code {
  color: #ff6347;
  background: rgba(217, 38, 38, 0.2);
}
.text-error a,
.text-error a code {
  text-decoration: underline;
  color: #ff3814;
}
.text-error a:hover,
.text-error a code:hover {
  color: #fa2500;
}
